import React from "react";
import Card from "./Card";
import { useSelector } from "react-redux";
import styled from "styled-components";

export const products = ["Bike", "Tread", "iOS", "Apple Watch", "Android", "FireTV", "Members"];
function Home() {
  const colorSelected = useSelector(appState => appState.selectedProduct);
  console.log('did this work taylor?', colorSelected);
  return (
    <>
      <PageTitle>Welcome to Peloton Members' Feedback App!</PageTitle>
      {/* <PageContainer> */}
      <main style={{ padding: "20px" }} className="container">
        <div className="mx-auto">
          <ul className="row justify-content-left" margin="auto">
          {products.map((product, index) => (
            <Card product={product} key={index} />
          ))}
          </ul>
        </div>
        {/* </PageContainer> */}
      </main>
    </>
  );
};

const PageContainer = styled.main`
  flex: 1 0 auto;
  padding: 40px;
  class-name: container;
`;

const PageTitle = styled.h1`
  text-align: center;
`

export default Home;
